data:
  definition: 'комплект, состоящий из гибкого кабеля или шнура, армированного неразборной
    вилкой и неразборной переносной розеткой, которые по конструкции соответствуют
    друг другу


    Примечание. Шнур называется «разнородным шнуром», если вилка и розетка по конструкции
    не соответствуют друг другу'
  examples: []
  notes: []
